import React, { useState, useEffect } from 'react';
import axios from 'axios';
import'./dashboard.css';

const Dashboard = () => {
    const [userDetails, setUserDetails] = useState<any>(null); // State to hold user details
    const authenticatedUserEmail = 'user@example.com'; // Replace with your authentication logic

    useEffect(() => {
        // Make an API request to fetch user details by email
        axios.get(`http://localhost:8085/userDetails/${authenticatedUserEmail}`)
            .then(response => {
                setUserDetails(response.data);
            })
            .catch(error => {
                console.log(error);
            });
    }, []);

    return (
        <div className="dashboard-container">
           <ul className='side-nav-items'>

    <li>Dashboard</li>

    <li>Time sheet</li>

    <li>Leave</li>

    <li>Work From Home</li>

    <li>Survey</li>

    <li>Service Desk</li>

    <li>Forms</li>

    <li>Travel</li>

    <li>Expenses</li>

<li>Resourcing</li>
<li >Profile</li>

</ul>
        </div>
    );
}

export default Dashboard;
